import React, { useState, useEffect } from "react"
import axios from "axios"
const CompA = ()=>{
    const [num,Setval] =useState()
    useEffect( ()=>{
        //alert("hy")
        fetch( "http://api.openweathermap.org/data/2.5/weather?q=jaipur&appid=ae91d24fdad4df324b35e5781c48a53d"

        )
        .then(response => {
            response.json();

        }).then
        .catch(err => {
            console.log(err);
        });

    })
  return(
      <> 
      <h1>you have choosed {num}</h1>
    <select onChange={ (e)=>{
        Setval(e.target.value)
    }}>
        <option value="1">1</option>
        <option value="3">3</option>
        <option value="4">4</option>
        <option value="5">5</option>
        <option value="11">11</option>
    </select>
      </>
  )

}

export default CompA;
